import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/DailyQuest.css';

const DailyQuest = () => {
  const navigate = useNavigate();

  const handleTabClick = (page) => {
    navigate(page); // 페이지 이동
  };

  const quests = [
    { task: "토끼 5마리 쓰다듬기", reward: 10 },
    { task: "토끼 2마리 빗어주기", reward: 10 },
    { task: "토끼 2마리 먹이기", reward: 10 },
  ];

  return (
    <div className="daily-quest">
      {/* 탭 메뉴 */}
      <div className="tabs">
        <button onClick={() => handleTabClick('/home')}>홈</button>
        <button onClick={() => handleTabClick('/profile')}>프로필</button>
        <button onClick={() => handleTabClick('/settings')}>설정</button>
      </div>

      {/* 일일 퀘스트 목록 */}
      <div className="quest-list">
        <h2>돌보미의 오늘 할 일</h2>
        <p>매일 자정에 초기화됩니다</p>
        {quests.map((quest, index) => (
          <div key={index} className="quest-item">
            <span className="task">{quest.task}</span>
            <span className="reward">{quest.reward} 포인트</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DailyQuest;
